import React from 'react'
import "./CarInstance.css"
import { Link } from 'react-router-dom';


interface Props {
  strImagePath: any,
  strMark: string,
  strPrice: string
}


const CarInstance = (props:Props) => {

  return (
    <Link to={{
      pathname: "/car",
      state: { car: props.car }
    }} className="btn car-image-wrapper col-md-4 col-sm-6 col-12">
      <img src={props.car.strImagePath} alt={props.car.strMark} />
        <p className="car-name">{props.car.strMark}</p>
        <p className="car-price">{props.car.strPrice}$/day</p>
    </Link>
  );
}


